    data: |
      SELECT ALL - col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + 90 NOT IN ( - - 70 - col2 * + col2, 77 * - - col0, + - 72, col2 + col1 / + ( col1 ), + col1, col2, CAST ( NULL AS INTEGER ), ( + 9 ) + + 38 );
  - name: tab2

outputs:
  - name: q2258.out
    data: |
